import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useLocation, useParams, useNavigate } from 'react-router-dom';

const GamePage = () => {
    const { gameId } = useParams();
    const navigate = useNavigate();
    const { state } = useLocation();
    const playerRole = state?.role;  // 'creator' or 'joiner'
    const [gameData, setGameData] = useState(null);
    const [playerName, setPlayerName] = useState(state?.playerName || '');
    const [secretNumber, setSecretNumber] = useState('');
    const [guess, setGuess] = useState('');
    const [guesses, setGuesses] = useState([]);
    const [turn, setTurn] = useState(0);  // Turn management
    const [message, setMessage] = useState('');

    useEffect(() => {
        axios.get(`http://localhost:5000/api/games/${gameId}`)
            .then(response => setGameData(response.data))
            .catch(err => {
                console.error('Error fetching game data:', err);
                setMessage('Error loading game data.');
            });
    }, [gameId]);

    const isValidSecretNumber = (number) => {
        const digits = number.split('');
        return digits.length === 4 && new Set(digits).size === 4 && /^\d{4}$/.test(number);
    };

    const handleSetSecretNumber = () => {
        if (!isValidSecretNumber(secretNumber)) {
            setMessage('Secret number must be 4 unique digits.');
            return;
        }
        axios.post(`http://localhost:5000/api/games/secret`, {
            gameId,
            secretNumber,
            player: playerRole
        })
            .then(() => {
                setMessage('Secret number set! Waiting for your opponent.');
                if (playerRole === 'creator') {
                    navigate(`/game/c/${gameId}`, { state: { role: 'creator' } });
                } else {
                    navigate(`/game/j/${gameId}`, { state: { role: 'joiner' } });
                }
            })
            .catch(err => {
                console.error('Error setting secret number:', err);
                setMessage('Error setting secret number.');
            });
    };

    const handleMakeGuess = () => {
        axios.post(`http://localhost:5000/api/games/guess`, {
            gameId,
            guess,
            player: gameData.players[turn]
        })
            .then(response => {
                setGuesses([...guesses, guess]);
                setTurn((turn + 1) % 2);  // Toggle between players
                setMessage(response.data.message);
            })
            .catch(err => {
                console.error('Error making guess:', err);
                setMessage('Error making guess.');
            });
    };

    if (!gameData) return <div>Loading game data...</div>;

    return (
        <div>
            <h1>Game: {gameId}</h1>
            <p>Players: {gameData.players.join(', ')}</p>
            <p>Status: {gameData.status}</p>

            {(!gameData.secretNumber1 || !gameData.secretNumber2) && (
                <div>
                    <h2>Set your secret number:</h2>
                    <input
                        type="text"
                        value={secretNumber}
                        onChange={(e) => setSecretNumber(e.target.value)}
                        maxLength={4}
                        placeholder="4 unique digits"
                    />
                    <button onClick={handleSetSecretNumber}>Set Secret Number</button>
                </div>
            )}

            {gameData.secretNumber1 && gameData.secretNumber2 && (
                <div>
                    <h2>Player {turn + 1}, make your guess:</h2>
                    <input
                        type="text"
                        value={guess}
                        onChange={(e) => setGuess(e.target.value)}
                        placeholder="Enter your guess"
                    />
                    <button onClick={handleMakeGuess}>Submit Guess</button>
                </div>
            )}

            <div>
                <h3>Message:</h3>
                <p>{message}</p>
            </div>

            <div>
                <h3>Previous Guesses:</h3>
                {guesses.map((g, index) => (
                    <p key={index}>Guess {index + 1}: {g}</p>
                ))}
            </div>
        </div>
    );
};

export default GamePage;
